import React from "react";

const CurrentTast = (status) => {
    if (status === 'a') {
        return (
            "주차장에서 하적장으로 이동하고 있습니다."
        )
    }
    else if (status === 'b') {
        return (
            <span>"하적장에서 창고로 이동하고 있습니다."</span>
        )
    }
    else if (status === 'c') {
        return (
            <span>"창고에서 하적장으로 이동하고 있습니다."</span>
        )
    }
    else if (status === 'd') {
        return (
            <span>"창고에서 주차장으로 이동하고 있습니다."</span>
        )
    }
    else if (status === 'e') {
        return (
            <span>"하적장에서 주차장으로 이동하고 있습니다."</span>
        )
    }
    else if (status === 'x') {
        return (
            <span>"짐을 싣는 중입니다."</span>
        )
    }
    else if (status === 'y') {
        return (
            <span>"짐을 내리는 중입니다."</span>
        )
    }
    else if (status === 'z') {
        return (
            <span>"회차하는 중입니다."</span>
        )
    }
}

export default CurrentTast;
